import React from "react";

const NewFilms = () => {

    const style = {
        background: {
            backgroundColor: "black",
            color: "white",
            paddingTop: "2%",
            paddingBottom: "2",
            height: "100%",
            width: "auto"
        }
    }
    return (
        <div style={style.background}>
            New Films
        </div>
    )
}

export default NewFilms;
